@rzeczpospolita może coś napisze 🤔bo tyle "mądrości" było przed wyborami do #PE ws. @Federacja_BiS 🤔🇵🇱

🤔🇵🇱🔧Ramy prawne nie określają w wystarczający sposób udziału urzędników państwowych w kampanii, z wyjątkiem wymogu bezstronności i niezależności od obowiązków służbowych, co podkreślono w kilku wyjaśnieniach PKW45. Niektórzy z rozmówców Misji IEOM zauważyli, że granica między obowiązkami służbowymi a działaniami w ramach kampanii często wydawała się niewyraźna. Urzędnicy państwowi na różnych szczeblach i z różnych środowisk politycznych, w tym członkowie rządu, parlamentu i władz lokalnych, przyłączali się do kandydatów podczas wydarzeń kampanijnych, wygłaszali przemówienia popierające lub promowali ich w sieciach społecznościowych47. Wsparcie to często pokrywało się z udziałem partii w kampanii, w tym lokalną koordynacją, wydarzeniami i promocją w sieciach społecznościowych – pomimo ograniczeń określonych w wyjaśnieniach PKW48. Praktyki te sprawiały, że granice między kampanią, działalnością partyjną i obowiązkami publicznymi były często nie do odróżnienia dla wyborców, co było sprzeczne z międzynarodowymi dobrymi praktykami49. Kandydaci z ograniczonym lokalnym wsparciem organizacyjnym i funduszami zgłosili Misji IEOM swoje zastrzeżenia dotyczące nierównych szans i wyzwań związanych z rywalizacją z kandydatami wspieranymi przez ugruntowane siły polityczne.

